let type = env.get("Data");

if(type == "1")
{
    msg.payload = msg.payload.battery_data;
    node.status({ fill: "green", shape: "dot", text: "Battery" });
}
else if (type == "2")
{
    msg.payload = msg.payload.stm32_data;
    node.status(
        { 
            fill: "blue", 
            shape: "dot", 
            text: "Energy Meter" 
            }

        );
}
else if (type == "3"){
    msg.payload = msg.payload.low_voltage;
    node.status(
        {
            fill: "yellow",
            shape: "dot",
            text: "Low Voltage Parameter"
        }

    );
}
else {
    msg.payload = msg.payload.reconnect_voltage;
    node.status(
        {
            fill: "yellow",
            shape: "dot",
            text: "Reconnect Voltage Parameter"
        }

    );
}


return msg;

